import React, { useEffect, useState } from 'react';
import {
  Container,
  TextField,
  Button,
  Typography,
  Paper,
  MenuItem,
  Grid,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Box
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import { LocalizationProvider, TimePicker } from '@mui/x-date-pickers';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';

function CustomerPage() {
  const [customers, setCustomers] = useState([]);
  const [name, setName] = useState('');
  const [appointment, setAppointment] = useState(null);
  const [barber, setBarber] = useState('');

  useEffect(() => {
    fetchCustomers();
  }, []);

  const fetchCustomers = () => {
    fetch('http://localhost:5000/api/customers')
      .then((response) => response.json())
      .then((data) => setCustomers(data))
      .catch((error) => console.error('Error fetching customers:', error));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!appointment) return;

    const formattedTime = appointment.toLocaleTimeString([], {
      hour: '2-digit',
      minute: '2-digit',
    });

    const newCustomer = { name, appointment: formattedTime, barber };

    fetch('http://localhost:5000/api/customers', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newCustomer),
    })
      .then(() => {
        fetchCustomers();
        setName('');
        setAppointment(null);
        setBarber('');
      })
      .catch((err) => console.error('Error:', err));
  };

  const handleDelete = (id) => {
    fetch(`http://localhost:5000/api/customers/${id}`, {
      method: 'DELETE',
    })
      .then(() => fetchCustomers())
      .catch((err) => console.error('Error deleting customer:', err));
  };

  const grouped = customers.reduce((acc, curr) => {
    acc[curr.barber] = acc[curr.barber] || [];
    acc[curr.barber].push(curr);
    return acc;
  }, {});

  return (
    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <Container maxWidth="md" sx={{ mt: 5 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h4" gutterBottom>
            Book Your Appointment
          </Typography>
          <Box component="form" onSubmit={handleSubmit} sx={{ mb: 4 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={4}>
                <TextField
                  fullWidth
                  label="Your Name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  required
                />
              </Grid>
              <Grid item xs={12} sm={4}>
                <TimePicker
                  label="Select Time"
                  value={appointment}
                  onChange={(newValue) => setAppointment(newValue)}
                  renderInput={(params) => <TextField {...params} required fullWidth />}
                />
              </Grid>
              <Grid item xs={12} sm={4}>
                <TextField
                  fullWidth
                  select
                  label="Choose Barber"
                  value={barber}
                  onChange={(e) => setBarber(e.target.value)}
                  required
                >
                  <MenuItem value="Raj">Raj</MenuItem>
                  <MenuItem value="Aman">Aman</MenuItem>
                  <MenuItem value="Sana">Sana</MenuItem>
                </TextField>
              </Grid>
            </Grid>
            <Button
              type="submit"
              variant="contained"
              sx={{ mt: 3 }}
              size="large"
              fullWidth
            >
              Book Appointment
            </Button>
          </Box>

          <Typography variant="h5" gutterBottom>
            Queues
          </Typography>
          <Grid container spacing={3}>
            {Object.keys(grouped).map((barberName) => (
              <Grid item xs={12} md={4} key={barberName}>
                <Paper sx={{ p: 2 }}>
                  <Typography variant="h6">{barberName}'s Queue</Typography>
                  <List>
                    {grouped[barberName].map((customer) => (
                      <ListItem
                        key={customer.id}
                        secondaryAction={
                          <IconButton
                            edge="end"
                            aria-label="delete"
                            onClick={() => handleDelete(customer.id)}
                          >
                            <DeleteIcon />
                          </IconButton>
                        }
                      >
                        <ListItemText
                          primary={`${customer.name} – ${customer.appointment}`}
                        />
                      </ListItem>
                    ))}
                  </List>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </Paper>
      </Container>
    </LocalizationProvider>
  );
}

export default CustomerPage;
